// A map of icon names to components
const icons = {
  home: HomeIcon,
  inbox: InboxIcon,
  search: SearchIcon,
  assistant: AssistantIcon,
  people2: People2Icon,
  bolt: BoltIcon,
  calendar: CalendarIcon,
  barChart: BarChartIcon,
  clock: ClockIcon,
  moneyStack: MoneyStackIcon,
  recruiting: RecruitingIcon,
  performance: PerformanceIcon,
  training: TrainingIcon,
  moneyBag: MoneyBagIcon,
  shieldCheckmark: ShieldCheckmarkIcon,
  surveys: SurveysIcon,
  dashboard: DashboardIcon,
  rectangleHorizontalArrowDown: RectangleHorizontalArrowDownIcon,
  gear: GearIcon,
  lifeBelt: LifeBeltIcon,
  sideBarLeft: SideBarLeftIcon,
};

export type IconName = keyof typeof icons;

interface IconProps {
  name: IconName;
  className?: string;
  size?: number;
}

// The main Icon component that dispatches to the correct icon
export function Icon({ name, className, size = 20 }: IconProps) {
  const IconComponent = icons[name];
  if (!IconComponent) {
    // Return a fallback or null
    return null;
  }
  return <IconComponent className={className} width={size} height={size} />;
}